# standard imports
import unittest

# third party imports

# local imports
from elementary import from_endf_reaction_number
from elementary import ParticleID
from elementary import ReactionID

class Test_elementary_from_endf_reaction_number( unittest.TestCase ) :
    """Unit test for the from_endf_reaction_number function."""

    def test_values( self ) :

        neutron = ParticleID( 'n' )
        proton = ParticleID( 'p' )
        Fe56_e0 = ParticleID( 'Fe56' )
        Fe56_e1 = ParticleID( 'Fe56_e1' )

        # incident neutrons
        self.assertTrue( ReactionID( 'n,Fe56->n,Fe56' ), from_endf_reaction_number( neutron, Fe56_e0, 2 ) )
        self.assertTrue( ReactionID( 'n,Fe56->non-elastic' ), from_endf_reaction_number( neutron, Fe56_e0, 3 ) )
        self.assertTrue( ReactionID( 'n,Fe56->anything' ), from_endf_reaction_number( neutron, Fe56_e0, 5 ) )
        self.assertTrue( ReactionID( 'n,Fe56->disappearance' ), from_endf_reaction_number( neutron, Fe56_e0, 101 ) )
        self.assertTrue( ReactionID( 'n,Fe56->absorption' ), from_endf_reaction_number( neutron, Fe56_e0, 27 ) )

        self.assertTrue( ReactionID( 'n,Fe56->n,n,h2,Mn53' ), from_endf_reaction_number( neutron, Fe56_e0, 11 ) )
        self.assertTrue( ReactionID( 'n,Fe56->n,n,Fe55' ), from_endf_reaction_number( neutron, Fe56_e0, 16 ) )
        self.assertTrue( ReactionID( 'n,Fe56->n,n,n,Fe54' ), from_endf_reaction_number( neutron, Fe56_e0, 17 ) )
        self.assertTrue( ReactionID( 'n,Fe56->n,he4,Cr52' ), from_endf_reaction_number( neutron, Fe56_e0, 22 ) )
        self.assertTrue( ReactionID( 'n,Fe56->n,he4,he4,he4,Ca44' ), from_endf_reaction_number( neutron, Fe56_e0, 23 ) )
        self.assertTrue( ReactionID( 'n,Fe56->n,n,he4,Cr51' ), from_endf_reaction_number( neutron, Fe56_e0, 24 ) )

        self.assertTrue( ReactionID( 'n,Fe56->n,n,n,n,Fe53' ), from_endf_reaction_number( neutron, Fe56_e0, 37 ) )

